def my_func(input1:str):
    if len(input1) < 1 or len(input1) > 100:
        return None
    max_char = ''
    max_count = 0
    current_char = ''
    current_count = 0
    for i, char in enumerate(input1):
        if char.isalnum():
            if char == current_char:
                current_count += 1
            else:
                current_char = char
                current_count = 1
            if current_count > max_count:
                max_count = current_count
                max_char = current_char
    return max_char
